    true,nt"url": null,nt"notes": "<p>The Centers for Medicare and Medicaid
    Services (CMS) released a new dataset, the Referring Provider Durable Medical Equipment,
    Prosthetics, Orthotics and Supplies (DMEPOS) Public Use File (Referring Provider
    DMEPOS PUF).  This data set, which is part of CMSs Medicare Provider Utilization
    and Payment Data set, details information on DMEPOS products and services provided
    to Medicare beneficiaries via referrals through physicians and other healthcare
    professionals.  Some examples include wheelchairs, walkers, oxygen supplies, nebulizers,
    and diabetes testing supplies, as wells as other products such as enteral-parenteral
    nutrition, inhalation solutions, and certain chemotherapy drugs.  These new data
    include information on 385,915 referring providers, over 100 million claims, and
    11 billion dollars in Medicare allowed payments for 2013.</p>n",nt"license_title":
